import React from "react";
import styled from "styled-components";

const Contacts = () => {

    function updateTime() {
        var currentTime = new Date()
        var hours = currentTime.getHours()
        var minutes = currentTime.getMinutes()
        if (minutes < 10) {
            minutes = "0" + minutes
        }
        var t_str = hours + ":" + minutes + " ";
        return t_str;
        ocument.getElementById('current').innerHTML = t_str;
    }
    setInterval(updateTime, 1000);

    return (
        <ContactsContainer>
            <Iphone>
                <StatusBar>
                    <LeftSide className="primaryButtonText" id="currentTime"></LeftSide>
                    <RightSide>
                        <img src="/iPhoneImage/mobile-signal.svg" alt="mobile-signal"></img>
                        <img src="/iPhoneImage/Wifi.svg" alt="wi-fi"></img>
                        <img src="/iPhoneImage/Battery.svg" alt="battery"></img>
                    </RightSide>
                </StatusBar>
            </Iphone>
        </ContactsContainer>
    )
}

const ContactsContainer = styled.div`
    width: 70%;
    height: 100vh;
    margin: 90px auto;
    align-items: center;
    display: flexbox;
`

const Iphone = styled.div`
    width: 437px;
    height: 882px;
    margin: 0px auto;
    background-image: url(/iPhoneImage/iPhoneImage.svg);
`

const StatusBar = styled.div`
    width: 85%;
    height: 47px;
    margin: 1.2em auto;
    display: flex;
    flex-direction: row;
    align-items: center;
    justify-content: space-between;
`

const LeftSide = styled.span`
    width: 54px;
    height: 21px;
    padding-left: 1.5em;
`

const RightSide = styled.span`
    width: 78px;
    display: flex;
    padding-right: 1em;
    flex-direction: row;
    align-items: center;
    justify-content:  space-between;
`

export default Contacts;
